        <Typography  component='div' fontWeight={600} fontSize={20}>
        Properties To Buy
        </Typography>
        {/* <Typography variant='h6' component='div'>
        Let’s find a home that’s perfect for you
        </Typography> */}
        {/* subtitle */}
    </Box>
  )
}

export default Text
